import React from 'react'

const NoteItem = (props) => {
    const { note } = props;
    return (
        <div className='col-md-3 my-3'>
            <div class="card my-3">
                <div class="card-header">
                    {note.title}
                </div>
                <p class="card-text">{note.description}</p>
                <i class="fa-regular fa-trash-can"></i>
            </div>
        </div>
    )
}

export default NoteItem
